    newSummary[10].activity = getRp11().toFixed(3);
    newSummary[11].activity = getRp12().toFixed(3);
    newSummary[12].activity = getRp13().toFixed(3);
    newSummary[13].activity = getRp14().toFixed(3);
    newSummary[14].activity = getRp15().toFixed(3);
    newSummary[15].activity = getRp16().toFixed(3);
    newSummary[16].activity = getRp17().toFixed(3);
    newSummary[17].activity = getRp18().toFixed(3);
    const newActive = [...active];
    newActive[0].d0 = X1().toFixed(2);
    newActive[1].d0 = X2().toFixed(2);
    newActive[2].d0 = X3().toFixed(2);
    newActive[3].d0 = X4().toFixed(2);
    newActive[4].d0 = X5().toFixed(2);
    newActive[5].d0 = X6().toFixed(2);
    newActive[6].d0 = X7().toFixed(2);
    newActive[7].d0 = X8().toFixed(2);
    newActive[8].d0 = X9().toFixed(2);

    setActive(newActive);
    setSummary(newSummary);
    setValues(newArray);
  };

  const renderQuestions = () => {
    // eslint-disable-next-line
    return data1.users.map((question, index) => {
      if (question.dim === 1) {
        return (
          <Grid container xs={12} key={index}>
            <Question
              index={index}
              no={question.no}
              value={data[index].value}
              header={question.q1}
              description={question.q2}
              sub1={question.s1}
              sub2={question.s2}
              dim={question.dim}
              handleChange={(e) => handleChange(e, index)}
            />
          </Grid>
        );
      }
    });
  };

  //
  return (
    <div>
      <Box bgcolor="background.paper" spacing={10}>
        <FormControl component="fieldset">{renderQuestions()}</FormControl>
      </Box>
    </div>
  );
}
